import React from "react";
import "./Hero.css";

const Hero = () => {
  return (
    <>
      <div className="hero">
        <h1>Welcome to Your Yoga Journey</h1>
        <p>
          Discover inner peace and vitality through yoga and meditation. Join
          our classes today.
        </p>
        <span>
          <button>Explore Classes</button>
        </span>
      </div>
    </>
  );
};

export default Hero;
